import React from "react";

import "../../App.css";
import "./Footer.css";

const Footer = () => {
  return (
    <>
      <section className="footer" id="footer">
        <div className=" f_flex">
          <div className="footer_container">heelo</div>
        </div>
      </section>
    </>
  );
};

export default Footer;
